**Describe the bug**
I modified the LSTM node in my model so that I get hidden states of LSTM as model outputs, and they are passed as model inputs in the next call. When I want to test run inference, I declare a numpy array of zeros to pass into session as initial state, but the session prints the error:
> InvalidArgument: [ONNXRuntimeError] : 2 : INVALID_ARGUMENT : Invalid rank for input: LSTM__25_inState Got: 4 Expected: 3 Please fix either the inputs or the model.


**Urgency**
Project deadline by the end of the week, so please respond if possible, thank you!

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Google Colab
- ONNX Runtime installed from (source or binary): binary
- ONNX Runtime version: 1.8.1
- Python version: 3.7
- Visual Studio version (if applicable):
- GCC/Compiler version (if compiling from source):
- CUDA/cuDNN version:
- GPU model and memory:

**To Reproduce**
- Describe steps/code to reproduce the behavior.
I modified my LSTM node following the instructions here: https://github.com/microsoft/onnxruntime/issues/6936#issuecomment-826543753

```
model = onnx.load(ONNX_PATH)

# change initial_h value
# 199: LSTM__25
model.graph.node[199].input[5] = 'LSTM__25_inState'

# create input value_info
LSTM__25_inState = helper.make_tensor_value_info(
        name='LSTM__25_inState', 
        elem_type=1,
        shape=[1,None,400],)
LSTM__25_inState.type.tensor_type.shape.dim[1].dim_param = 'unk__1016'

# create output value_info
LSTM__25_outState = helper.make_tensor_value_info(
        name='LSTM__25:0',
        elem_type=1,
        shape=[1,None,400],
)
LSTM__25_outState.type.tensor_type.shape.dim[1].dim_param = 'unk__1024'

model.graph.input.append(LSTM__25_inState)
model.graph.output.append(LSTM__25_outState)

onnx.checker.check_model(model) # checker does not raise any error
onnx.save(model, ONNX_PATH)
```

After modification, my model inputs:
