}
, name: "LSTM__25_inState"
type {
  tensor_type {
    elem_type: 1
    shape {
      dim {
        dim_value: 1
      }
      dim {
        dim_param: "unk__1016"
      }
      dim {
        dim_value: 400
      }
    }
  }
}
]
```

model outputs:
```
