      }
    }
  }
}
, name: "LSTM__25:0"
type {
  tensor_type {
    elem_type: 1
    shape {
      dim {
        dim_value: 1
      }
      dim {
        dim_param: "unk__1024"
      }
      dim {
        dim_value: 400
      }
    }
  }
}
]
```

Once I have the saved ONNX model, I load it into ONNX Inference Session, and load my data/declare initial LSTM zero state:
```
initState_25 = np.zeros((1,1,400)).astype(np.float32)
```

And pass it along with my original data into the session.

- Attach the ONNX model to the issue (where applicable) to expedite investigation.

**Expected behavior**
What baffles me is that I clearly initialized the LSTM zero state as a 3D tensor, but somehow when passing into the model, the rank becomes 4 instead of 3. I also tried initializing the state tensor as
```
initState_25 = np.zeros((1,400)).astype(np.float32)
```
But then it just prints that the rank is 2, while expected 3.

**I printed out `session.get_inputs()` after encountering the error, and the shape of the tensor for the LSTM state became `(60, 1, 1, 400)` from `(1, 1, 400)`, and I am not sure as to why the model adds the first dimension.**


